import React from 'react'
import { Link, useParams } from 'react-router-dom'


interface Props{
    page:number
    setPage:(number:number)=>void
}

export default function Pagination(props:Props) {
    const page = window.location.pathname.substring(window.location.pathname.lastIndexOf('/') + 1)
    // console.log(Number(page)===Number(props.page));
    // console.log("trang "+ props.page + " param: "+page);
    return (
        <span onClick={()=>props.setPage(props.page)} >{props.page}</span> 
    )
}
